import React from 'react'
import styled from "styled-components";
const MyImage = ({img = [{url:""}]}) => {
  console.log(img)
  return (
   <>
<Wrapper>
<div className='product_images'>
<div className='grid grid-four-column'>
{
  img.map((currentData,index) =>{
    return(
      <figure>
        <img 
        src={currentData.url} 
        alt={currentData.filename}
        key={index}
        />
      </figure>
    );
  })
}
</div>

{/* //2nd column// */}

<div className='product_bgimg'>
  <img src={img[0].url} alt={img[0].filename}/>
</div>
</div>

</Wrapper>
   </>
  )
}
const Wrapper = styled.section`
.product_images{
  display:flex;
  flex-direction:row;
  align-items:center;
  justify-content:center;
  padding-left:2rem;
  gap:2rem

  .grid{
  display: grid;
  gap: 1rem;
  margin:0
}
.grid-four-column{
  display:flex;
  flex-direction:column;
  margin-top:3rem;
}
figure{
  img{
    width:13rem;
    height:9rem;
  }
}
.product_bgimg{
  img{
    width:20rem;
  height:15rem;
  }
}
}
`;
export default MyImage;
